import './App.css';
import {Login} from './components/login/Login';
import { Home } from './components/mainScreen/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import PaymentHistoryPage from './components/paymentHistory/PaymentHistoryPage';
import ViewBills from './components/viewBills/ViewBills';
import Pay from './components/payemntpage/Pay';
import { RequestAuth } from './auth/RequestAuth';
function App() {
  return (
    <>
            <Router>
                <Routes>

                    <Route element={<RequestAuth/>}>
                    <Route
                        exact
                        path="/"
                        element={<Home />}
                    />
                    <Route

                        path="/login"
                        element={<Login />}
                    />
                    <Route
                        path="/history"
                        element={<PaymentHistoryPage/>}
                    />
                     <Route
                        path="/view"
                        element={<ViewBills/>}
                    />
                     <Route
                        path="/pay"
                        element={<Pay/>}
                    />
                    <Route
                        path="*"
                        element={<Navigate to="/" />}

                    />
                    </Route>
                </Routes>
            </Router>
        </>
  );
}

export default App;
